  var hour=2;
  var minute=10;
  var today="05";
  var completed="00";
    return(
      <div className="Dash Card">
      <br></br>
      <div className="block">
      <button className="btn btn-dark new-button" onclick="myList()">new</button>
      <span className="timer">{day}, {hour}:{minute} am</span>
      </div>
      <div className="card-body">
      <br></br>
      <div className="activity-wrap">
      <div className="activity">
      {today}<br></br>
      Today
      </div>
      <div className="activity">
      {completed}<br></br>
      Complete
      </div>

      </div>
      </div>

      </div>
  );
}
export default Dash;
